script: |
  super -f text -I q5892.spq | sort > q5892.out

inputs:
  - name: q5892.spq
    data: |
      SELECT DISTINCT 68 / + cor0.col1 FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0, tab1 (FORMAT parquet) cor1, tab2 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q5892.out
    data: |
      2
      5
      6
